import { Link } from "react-router-dom";

const TableRow = (props) => {
  const { board } = props;

  return (
    <tr>
      <td>{board.num}</td>
      <td>
        {/* 페이지 이동 코드 */}
        <Link to={`/board/view/${board.num}`}>{board.subject}</Link>
      </td>
      <td>{board.reg_date}</td>
      <td>{board.readcount}</td>
    </tr>
  );
};

export default TableRow;
